import React, { useState, useRef } from "react";
import { styled, alpha } from "@mui/material/styles";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import InputBase from "@mui/material/InputBase";
import Button from "@mui/material/Button";
import Stack from "@mui/material/Stack";
import SearchIcon from "@mui/icons-material/Search";
import {
  WhatsappIcon,
  WhatsappShareButton,
  EmailIcon,
  EmailShareButton,
  TelegramIcon,
  TelegramShareButton,
  TwitterIcon,
  TwitterShareButton,
  FacebookIcon,
  FacebookShareButton,
  InstapaperIcon,
  InstapaperShareButton,
} from "react-share";
import ReactPrint from "react-to-print";
import "./style.css";

export default function Invoice() {
  const [_id, setSearchData] = useState("");

  const [compName, setCompName] = useState("");
  const [compAddress, setCompAddress] = useState("");
  const [compNumber, setCompNumber] = useState("");
  const [compinvoiceId, setInvoiceID] = useState("");
  const [compInvoiceDate, setCompInvoiceDate] = useState("");
  const [customerName, setCustomerName] = useState("");
  const [customerAddress, setCustomerAddress] = useState("");
  const [customerNumber, setCustomerNumber] = useState("");
  const [customerEmail, setCustomerEmail] = useState("");
  const [compdueDate, setDueDate] = useState("");
  const [paymentDate, setPaymentDate] = useState("");
  const [tableProductDate, setTableProductDate] = useState("");
  const [Description, setDescription] = useState("");
  const [quntity, setQuntity] = useState("");
  const [rate, setRate] = useState("");
  const [amount, setAmounts] = useState("");
  const [tax, setTax] = useState("");
  const [taxAmount, setTaxAmount] = useState("");
  const [totalAmount, setTotalAmount] = useState("");
  const [tablePaymentId, setTablePaymentId] = useState("");
  const [tableBankName, setTableBankName] = useState("");
  const [tableAccNumber, setTableAccNumber] = useState("");
  const [tableifscCode, setTableifscCode] = useState("");

  const handelevent = async (e) => {
    e.preventDefault();

    await fetch("http://localhost:5000/invoice/" + _id, { method: "get" })
      .then((res) => res.json())
      .then((da) => {
        console.log(da.compName);
        setCompName(da.compName);
        setCompAddress(da.compAddress);
        setCompNumber(da.compNumber);
        setInvoiceID(da._id);
        setCompInvoiceDate(da.compInvoiceDate);
        setCustomerName(da.customerName);
        setCustomerAddress(da.customerAddress);
        setCustomerNumber(da.customerNumber);
        setCustomerEmail(da.customerEmail);
        setDueDate(da.compdueDate);
        setPaymentDate(da.paymentDate);
        setTableProductDate(da.tableProductDate);
        setDescription(da.Description);
        setQuntity(da.quntity);
        setRate(da.rate);
        setAmounts(da.amount);
        setTax(da.tax);
        setTaxAmount(da.taxamount);
        setTotalAmount(da.totalAmount);
        setTablePaymentId(da.tablePaymentId);
        setTableBankName(da.tableBankName);
        setTableAccNumber(da.tableAccNumber);
        setTableifscCode(da.tableifscCode);
      });
  };

  const printRef = useRef();

  return (
    <div>
      <div ref={printRef} className="page">
        <div className="HeaderDiv">
          <div className="column">
            <img
              src="https://sourceit.com.ua/images/courses/react.png?111"
              alt=""
              className="ImageLogo"
            ></img>
            <div className="CompanyDetails">
              <h4 name="companyName">[{compName}]</h4>
              <h4 name="companyAddress">[{compAddress}]</h4>
              <h4 name="companyNumber">[{compNumber}]</h4>
              <h4 name="website">
                <a href="https://qliclabs.com/">[qliclabs.com]</a>
              </h4>
            </div>
            <div className="CustomerDetails">
              <h4>Invoice to:</h4>
              <h4>[{customerName}]</h4>
              <h4>[{customerAddress}]</h4>
              <h4>[{customerNumber}]</h4>
              <h4>[{customerEmail}]</h4>
            </div>
          </div>
          <div className="column">
            <h1 className="InvoceHeading">TAX INVOICE</h1>
            <div>
              <div className="InvoiceColumn1">
                <h5>Invoice #</h5>
                <h4>{compinvoiceId}</h4>
                <h5 className="duedate">Due Date</h5>
                <h4>[{compdueDate}]</h4>
              </div>
              <div className="InvoiceColumn2">
                <h5>Invoice Date</h5>
                <h4>{compInvoiceDate}</h4>
                <h5 className="duedate">PaymentDate</h5>
                <h4>[{paymentDate}]</h4>
              </div>
            </div>
          </div>
        </div>
        <table className="table" id="customers">
          <thead>
            <tr>
              <th>Date</th>
              <th>Description</th>
              <th>Qty/Hrs</th>
              <th>Rate</th>
              <th>Amount</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>{tableProductDate}</td>
              <td>{Description}</td>
              <td>{quntity}</td>
              <td>{rate}</td>
              <td>{amount}</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>
          </tbody>
        </table>
        <div>
          <div className="footermainDiv">
            <div className="FooterSubDiv1">
              <h5>Payment Methods:</h5>
              <h4 className="paymentDetails">[{tablePaymentId}]</h4>
              <h4>We accept Visa Master Card, etc</h4>
              <h5 className="bankDetails">Bank Details:</h5>
              <h4>[{tableBankName}]</h4>
              <h4>[{tableAccNumber}]</h4>
              <h4>[{tableifscCode}]</h4>
            </div>
            <div className="FooterSubDiv2">
              <table id="totals">
                <tbody>
                <tr>
                  <td>Subtotal</td>
                  <td>{amount}</td>
                </tr>
                <tr>
                  <td>Tax @ {tax}%</td>
                  <td>{taxAmount}</td>
                </tr>
                <tr>
                  <td>Others</td>
                  <td></td>
                </tr>
                <tr>
                  <th>Total</th>
                  <th>{totalAmount}</th>
                </tr>
                </tbody>
              </table>
            </div>
          </div>
          <div className="thankyoudiv">
            <h3>Thank You For Your Business!</h3>
          </div>
        </div>
      </div>
      <Box sx={{ flexGrow: 1 }}>
        <AppBar>
          <Toolbar>
            <Search>
              <SearchIconWrapper>
                <SearchIcon />
              </SearchIconWrapper>
              <StyledInputBase
                placeholder="Searchâ€¦"
                id="searchId"
                onChange={(e) => setSearchData(e.target.value)}
              />
            </Search>
            <Stack sx={{ display: "inline-block", width: "150px" }}>
              <Button
                variant="contained"
                onClick={handelevent}
                sx={{ backgroundColor: "greenyellow" }}
              >
                Search
              </Button>
            </Stack>
            <Box sx={{ flexGrow: 1 }} />
            <Box sx={{ display: { xs: "none", md: "flex" } }}>
              <EmailShareButton
                url="https://mail.google.com/mail/u/0/#inbox"
                edge="end"
              >
                <EmailIcon
                  round={true}
                  style={{ height: "50px", width: "50px", margin: "10px" }}
                />
              </EmailShareButton>
              <WhatsappShareButton url="https://web.whatsapp.com/" edge="end">
                <WhatsappIcon
                  round={true}
                  style={{ height: "50px", width: "50px", margin: "10px" }}
                />
              </WhatsappShareButton>
              <TelegramShareButton url="https://web.telegram.org/z/" edge="end">
                <TelegramIcon
                  round={true}
                  style={{ height: "50px", width: "50px", margin: "10px" }}
                />
              </TelegramShareButton>
              <TwitterShareButton
                url="https://twitter.com/i/flow/login"
                edge="end"
              >
                <TwitterIcon
                  round={true}
                  style={{ height: "50px", width: "50px", margin: "10px" }}
                />
              </TwitterShareButton>
              <FacebookShareButton
                url="https://www.facebook.com/login/"
                edge="end"
              >
                <FacebookIcon
                  round={true}
                  style={{ height: "50px", width: "50px", margin: "10px" }}
                />
              </FacebookShareButton>
              <InstapaperShareButton
                url="https://www.instagram.com/accounts/login/"
                edge="end"
              >
                <InstapaperIcon
                  round={true}
                  style={{ height: "50px", width: "50px", margin: "10px" }}
                />
              </InstapaperShareButton>
              <ReactPrint
                trigger={() => (
                  <Button
                    style={{
                      backgroundColor: "orange",
                      color: "white",
                      height: "50px",
                      width: "100%",
                      margin: "10px",
                      fontSize: "20px",
                    }}
                  >
                    Print/Download
                  </Button>
                )}
                content={() => printRef.current}
              />
            </Box>
          </Toolbar>
        </AppBar>
      </Box>
    </div>
  );
}

const Search = styled("div")(({ theme }) => ({
  position: "relative",
  borderRadius: theme.shape.borderRadius,
  backgroundColor: alpha(theme.palette.common.white, 0.15),
  "&:hover": {
    backgroundColor: alpha(theme.palette.common.white, 0.25),
  },
  marginRight: theme.spacing(2),
  marginLeft: 0,
  width: "100%",
  [theme.breakpoints.up("sm")]: {
    marginLeft: theme.spacing(3),
    width: "auto",
  },
}));

const SearchIconWrapper = styled("div")(({ theme }) => ({
  padding: theme.spacing(0, 2),
  height: "100%",
  position: "absolute",
  pointerEvents: "none",
  display: "flex",
  alignItems: "center",
  justifyContent: "center",
}));

const StyledInputBase = styled(InputBase)(({ theme }) => ({
  color: "inherit",
  "& .MuiInputBase-input": {
    padding: theme.spacing(1, 1, 1, 0),
    // vertical padding + font size from searchIcon
    paddingLeft: `calc(1em + ${theme.spacing(4)})`,
    transition: theme.transitions.create("width"),
    width: "100%",
    [theme.breakpoints.up("md")]: {
      width: "20ch",
    },
  },
}));
